PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "after_schools" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "date" date, "time_in" datetime, "time_out" datetime, "total_minutes" integer, "homework_time" integer, "literacy_time" integer, "technology_time" integer, "reading_specialist_time" integer, "goal" text, "created_at" datetime, "updated_at" datetime, "program_id" integer, "child_id" integer, "notes" text, "physical_activity" integer, "hands_on_activity" integer);
CREATE TABLE "assignments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "instructor_id" integer, "location_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "child_locations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "child_id" integer, "location_id" integer, "start_date" date, "end_date" date, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "children" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "first_name" varchar(255), "last_name" varchar(255), "date_of_birth" date, "grade" varchar(255), "school_id" integer, "guardian_id" integer, "active" boolean DEFAULT 't', "created_at" datetime, "updated_at" datetime);
CREATE TABLE "enrichment_days" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "child_id" integer, "enrichment_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "enrichments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "length" float, "notes" text, "created_at" datetime, "updated_at" datetime, "program_id" integer, "provider_id" integer);
CREATE TABLE "enrollments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "program_id" integer, "child_id" integer, "date_enrolled" date, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "field_trip_days" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "child_id" integer, "field_trip_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "field_trips" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "length" float, "notes" text, "created_at" datetime, "updated_at" datetime, "program_id" integer, "provider_id" integer);
CREATE TABLE "guardian_locations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "guardian_id" integer, "location_id" integer, "start_date" date, "end_date" date, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "instructors" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "first_name" varchar(255), "last_name" varchar(255), "user_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "locations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "address_line_one" varchar(255), "address_line_two" varchar(255), "city" varchar(255), "state" varchar(255), "zip" varchar(255), "phone" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "programs" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "program_type" varchar(255), "start_date" varchar(255), "end_date" varchar(255), "location_id" integer(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "providers" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "school_districts" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "schools" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "phone" varchar(255), "address_line_one" varchar(255), "address_line_two" varchar(255), "city" varchar(255), "state" varchar(255), "zip" varchar(255), "created_at" datetime, "updated_at" datetime, "school_district_id" integer);
CREATE TABLE "sub_locations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "address_line_one" varchar(255), "address_line_two" varchar(255), "city" varchar(255), "state" varchar(255), "zip" varchar(255), "phone" varchar(255), "created_at" datetime, "updated_at" datetime, "location_id" integer);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "username" varchar(255), "password_digest" varchar(255), "role" varchar(255), "active" boolean DEFAULT 't', "created_at" datetime, "updated_at" datetime, "instructor_id" integer);
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "guardians" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "first_name" varchar(255), "last_name" varchar(255), "phone" varchar(255), "email" varchar(255), "user_id" integer, "created_at" datetime, "updated_at" datetime, "date_of_birth_two" date);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
